import React from "react";
import "./style.css";


//// This Header Component is for the search page (Your Learning Journey) ////


function Header() {
    return (
        <div className="jumbotron-fluid  bg-light text-center">
            <div className="container text-dark">
                <h1>Your Learning Journey</h1>
                <br />
            </div>
        </div>
    );
}

export default Header;
